INSERT INTO movieticketbooking.movies (movie_id, title, description, genres, director, actor, producer, language, duration, release_date, rating, image, trailer_url, movie_price)
VALUES
('OPFR2022', 'One Piece Film Red', 'Bộ phim xoay quanh Luffy và băng Mũ Rơm khi họ tham gia vào một sự kiện âm nhạc lớn, cả băng đã gặp Uta(một ca sĩ nổi tiếng, là người bạn thuở nhỏ của Luffy và cũng là con gái của Tứ Hoàng Shanks). Bộ phim mang đến những pha hành động mãn nhãn, âm nhạc sôi động và những tình tiết đầy bất ngờ, hứa hẹn sẽ làm hài lòng cả những fan lâu năm lẫn người xem mới.', 'Kỳ ảo, Hành động-Phiêu lưu', 'Gorō Taniguchi', 'Mayumi Tanaka, Shuichi Ikeda, Kaori Nazuka, Kazuya Nakai, Akemi Okamura, Kappei Yamaguchi, Hiroaki Hirata', 'Eiichiro Oda', 'Tiếng Nhật, Tiếng Anh, Phụ đề Tiếng Việt', '115', '2022-06-08', 'PG-13', 'https://vi.wikipedia.org/wiki/T%E1%BA%ADp_tin:One_Piece_Film-_Red_-_%C3%81p_ph%C3%ADch_Vi%E1%BB%87t_Nam.jpg', 'https://www.youtube.com/watch?v=L-aFL-bX1ao','350000'),
('DISY2021', 'Bố Già', 'Phim kể về ông Ba Sang, một người cha đơn thân sống trong khu xóm lao động nghèo ở Sài Gòn, và những mâu thuẫn giữa ông và con trai Quắn. Bộ phim khai thác sâu sắc tình cảm gia đình và cuộc sống của người dân lao động, với nhiều tình tiết hài hước và cảm động.', 'Hài-Chính kịch', 'Trấn Thành, Vũ Ngọc Đãng', 'Trấn Thành, Ngọc Giàu, Tuần Trần, Ngân Chi, Lê Gian, Hoàng Mèo, Lan Phương, La Thành, Lê Trang, Quốc Khánh, Một Bến Cảng, Bảo Phúc', 'Thảo Nguyễn', 'Tiếng Việt', '128', '2021-03-12', 'NR', 'https://vi.wikipedia.org/wiki/T%E1%BA%ADp_tin:Bo_gia_2021_ap_phich.jpg', 'https://www.youtube.com/watch?v=jluSu8Rw6YE', '300000'),
('DPBY2024', 'Dolphin Boy', 'Bộ phim xoay quanh một cậu bé phát hiện ra mình có khả năng giao tiếp với cá heo và cùng chúng trải qua những cuộc phiêu lưu dưới đại dương. Tác phẩm khai thác chủ đề tình bạn và bảo vệ môi trường biển, với nhiều hình ảnh đẹp và các cảnh hành động mãn nhãn.', 'Phiêu lưu, Hoạt hình, Gia đình', 'Mohammad Kheyrandish', 'Polina Avdeenko, Yuliya Rudina, Boris Khasanov', 'null', 'Tiếng Anh (lồng tiếng Việt khi chiếu tại Việt Nam)', '85', '2024-09-27', 'P', 'https://thegioidienanh.vn/stores/news_dataimages/2024/092024/23/18/dolphin-boy-official-poster20240923181226.png?rt=20240923181320', 'https://www.youtube.com/watch?v=hCmAntZAK2I', '200000'),
('SDCB2024', 'Bố Gà Siêu Đẳng: Trận Chiến Trên Băng', ' Bộ phim kể về hành trình của một người cha dũng cảm, hóa thân thành một siêu anh hùng để bảo vệ con gái mình và đối đầu với những thử thách khắc nghiệt trên băng giá. Tác phẩm này không chỉ đem lại cảm giác phiêu lưu mà còn khắc họa tình yêu gia đình đầy cảm động.', 'Hoạt hình, Phiêu lưu, Hài hước', 'Gabriel Riva Palacio Alatriste, Rodolfo Riva Palacio Alatriste', 'null', 'Huevocartoon Producciones', 'Tiếng Anh (lồng tiếng Việt khi chiếu tại Việt Nam)', '91', '2024-08-30', 'P', 'https://cdn.tuoitre.vn/471584752817336320/2024/8/16/screenshot40-17237817597591763198107.jpg', 'https://www.youtube.com/watch?v=fzSdot7abVM', '200000'),
('TOSS2024', 'Hai Muối', 'Hai Muối là câu chuyện cảm động về cuộc sống của một người cha đơn thân và cô con gái nhỏ. Trong bối cảnh miền quê yên bình, tình cha con được khắc họa qua những khoảnh khắc bình dị nhưng đầy xúc động. Bộ phim tập trung vào các giá trị gia đình, sự hy sinh và niềm tin vào tình yêu thương.', 'Tâm lý, Gia đình', 'NSƯT Vũ Thành Vinh', 'NSND Hồng Vân, NSND Việt Anh, Quyền Linh, NSƯT Công Ninh, diễn viên Minh Luân, Trần Kim Hải, Huỳnh Bảo Ngọc, Tú Tri, Năm Chà,...', 'null', 'Tiếng Việt', '115', '2024-08-30', 'P', 'https://photo.znews.vn/w480/Uploaded/wyhktpu/2024_08_21/HAI_MUOI_PAYOFF_POSTER_KTHUOC_FACEBOOK_.jpg', 'https://www.youtube.com/watch?v=MjxPoqCvvVs', '225000'),
('LMMU2024', 'Lật Mặt 7: Một Điều Ước', 'Phần thứ bảy của loạt phim hành động nổi tiếng Lật Mặt do Lý Hải đạo diễn, kể về cuộc phiêu lưu của một nhóm người trẻ đối mặt với nhiều thử thách nguy hiểm. Bộ phim kết hợp yếu tố hành động, hồi hộp và những khoảnh khắc cảm động về gia đình và tình bạn. Mỗi phần phim đều có câu chuyện và thông điệp riêng biệt, và phần 7 tiếp tục khắc họa sâu sắc tình cảm con người, đặc biệt là những ước mơ và quyết định trong cuộc sống.', 'Hành động, Phiêu lưu, Gia đình', '	Lý Hải', 'Thanh Hiền, Trương Minh Cường, Đinh Y, Nhung Quách, Ngọc Tuyên, Trâm Anh ,Trần Kim Hải', 'Lý Hải, Trần Minh Hà', 'Tiếng Việt', '120', '2024-04-26', 'C13', 'https://upload.wikimedia.org/wikipedia/vi/thumb/d/d4/%C3%81p_ph%C3%ADch_ch%C3%ADnh_th%E1%BB%A9c_L%E1%BA%ADt_m%E1%BA%B7t_7.jpg/330px-%C3%81p_ph%C3%ADch_ch%C3%ADnh_th%E1%BB%A9c_L%E1%BA%ADt_m%E1%BA%B7t_7.jpg', 'https://www.youtube.com/watch?v=d1ZHdosjNX8', '120000'),
('CDHM2024', 'Cô Dâu Hào Môn', 'Bộ phim xoay quanh câu chuyện của một cô gái trẻ, xuất thân từ gia đình bình thường, bỗng chốc trở thành thành viên của một gia đình giàu có khi cô kết hôn với một doanh nhân thành đạt. Tuy nhiên, cuộc sống xa hoa lại không như cô mong đợi khi cô phải đối mặt với những âm mưu, bí mật đen tối và áp lực từ gia đình chồng. Phim khai thác sâu các mối quan hệ gia đình, tình yêu và sự đối lập giữa giàu nghèo trong xã hội hiện đại.', 'Tâm lý, Tình cảm, Gia đình', 'Vũ Ngọc Đãng', 'Thu Trang, Uyển Ân, Kiều Minh Tuấn, NSND Hồng Vân, Lê Giang, Huy Anh, Quỳnh Lương...', 'Will Vũ', 'Tiếng Việt', '114', '2024-10-18', 'C16', 'https://bazaarvietnam.vn/wp-content/uploads/2024/09/Harpers-Bazaar-Kieu-Minh-Tuan-tang-13-kg-trong-Co-Dau-Hao-Mon_02.jpg', 'https://www.youtube.com/watch?v=QJ8E9R70csY', '150000'),
('CLNC2024', 'Cu Li Không Bao Giờ Khóc', 'Cu Li Không Bao Giờ Khóc là một bộ phim nghệ thuật Việt Nam kể về câu chuyện của một người phụ nữ trở về quê hương sau khi chồng qua đời. Trong hành trình đối mặt với nỗi đau và những bí mật trong quá khứ, cô phải khám phá lại chính mình và tìm thấy ý nghĩa của cuộc sống. Phim chứa đựng những thông điệp sâu sắc về tình yêu, mất mát, và bản sắc con người.', 'Tâm lý, Nghệ thuật', 'Phạm Ngọc Lân', 'Minh Châu, Hà Phương Ngô, Xuân An, Hoàng Hà, Cao Sang', 'Nghiêm Quỳnh Trang, Trần Thị Bích Ngọc', 'Tiếng Việt', '92', '2024-11-15', 'C16', 'https://upload.wikimedia.org/wikipedia/vi/thumb/b/bb/Cu_li_kh%C3%B4ng_bao_gi%E1%BB%9D_kh%C3%B3c_-_Cu_Li_Never_Cries_%28international_poster%29.png/330px-Cu_li_kh%C3%B4ng_bao_gi%E1%BB%9D_kh%C3%B3c_-_Cu_Li_Never_Cries_%28international_poster%29.png', 'https://www.youtube.com/watch?v=kMjlJkmt5nk', '110000'),
('VTKC2024', 'Venom: Kèo Cuối', 'Kèo Cuối là phần tiếp theo của loạt phim siêu anh hùng nổi tiếng về nhân vật Venom từ Marvel Comics. Bộ phim theo chân Eddie Brock (Tom Hardy), người đã hợp nhất với ký sinh trùng ngoài hành tinh Venom, trong cuộc chiến cuối cùng chống lại những kẻ thù mới. Bộ phim hứa hẹn nhiều pha hành động mãn nhãn và những khoảnh khắc hài hước đặc trưng giữa Venom và Eddie.', 'Hành động, Viễn tưởng, Siêu anh hùng', 'Kelly Marcel', 'Tom Hardy, Chiwetel Ejiofor, Juno Temple, Rhys Ifans, Peggy Lu, Alanna Ubach, Stephen Graham', 'Avi Arad, Matt Tolmach, Amy Pascal, Kelly Marcel, Tom Hardy, Hutch Parker', 'Tiếng Anh', '110', '2024-10-25', 'C16', 'https://scontent.fhan3-1.fna.fbcdn.net/v/t39.30808-6/461680648_566957269021540_7650410962980723135_n.jpg?_nc_cat=111&ccb=1-7&_nc_sid=833d8c&_nc_eui2=AeE2a7HBqsTa8L1MYZ0rZc1MNeSzYOzgeXQ15LNg7OB5dBn5y3PoRNW0Dc9HFDoZDPUwQbMtpxQC935y_nlEowh5&_nc_ohc=Qxyi42PV0FYQ7kNvgHWZkvB&_nc_ht=scontent.fhan3-1.fna&_nc_gid=AJXOi7tb9ImdwT104T7ysAe&oh=00_AYCj_VRWa5kcZzEtEsM8qEsePeAmYJq7RBEfEhzkjrBk5Q&oe=67065EA5', 'https://www.youtube.com/watch?v=I1q-jmvPNn0', '225000'),
('THCC2024', 'Tín Hiệu Cầu Cứu', 'Phim kể về Frida, một cô phục vụ quán bar, bị cuốn hút vào cuộc sống xa hoa của tỷ phú công nghệ Slater King. Frida theo Slater đến một hòn đảo thiên đường. Tuy nhiên, cô nhanh chóng phát hiện ra những bí mật đen tối ẩn giấu trên hòn đảo này và Slater. Bị mắc kẹt trong một trò chơi sinh tử, Frida phải chiến đấu để sinh tồn khi cuộc tàn sát bắt đầu.', 'Ly kỳ, Bí ẩn, Tâm lý, Tội phạm', 'Zoe Kravitz', 'Naomi Ackie, Channing Tatum, Christian Slater, Simon Rex, Adria Arjona, Kyle MacLachlan, Haley Joel Osment, Geena Davis, Alia Shawkat', 'Bruce Cohen, Tiffany Persons, Garret Levitz, Zoe Kravitz, Channing Tatum', 'Tiếng Anh', '102', '2024-10-18', 'T18', 'https://upload.wikimedia.org/wikipedia/vi/9/91/BLINK_TWICE_-_Vietnam_poster.jpg?20240906050207', 'https://www.youtube.com/watch?v=UKlNu6rzpHA', '175000'),
('NMCT2024', 'Ngày Xưa Có Một Chuyện Tình', 'Bộ phim xoay quanh câu chuyện tình yêu giữa hai chàng trai và một cô gái từ lúc nhỏ đến khi trưởng thành, phải đối mặt với nhiều thử thách trên đường đi.', 'Lãng mạn, Tâm lý', 'Trịnh Đình Lê Minh', 'Avin Lu, Ngọc Xuân, Đõ Nhật Hoàng,...', 'HKFILM, CJ HK và SATE', 'Tiếng Việt', '135',  '2024-11-01', 'T16', 'https://image.tienphong.vn/w645/Uploaded/2024/vvh-vicbuuwobu/2024_09_30/ngay-xua-8-6077.jpg', 'https://www.youtube.com/watch?v=Not4hIJxwpw', '120000'),
('DPVP2024', 'Đào, Phở và Piano', 'Bộ phim lấy bối cảnh trong trận chiến 60 ngày đêm tại Hà Nội vào cuối năm 1946 và đầu năm 1947. Kể về câu chuyện của một đôi trẻ, lính du kích Văn Đan và người Hà Nội Thục Hương, vượt qua hiểm nguy để tái hợp vào ngày 17 tháng 2 năm 1947, khi quân đội nhân dân Việt Nam bắt đầu rút lui khỏi Hà Nội về vùng chiến khu để tiến hành cuộc kháng chiến lâu dài.', 'Chiến tranh, Lãng mạn', 'Phi Tiến Sơn', 'Doãn Quốc Đam, Cao Thị Thùy Linh, Anh Tuấn,...', 'Nguyễn Minh Phương, Phan Đình Thanh', 'Tiếng Việt', '100', '2024-02-10', 'T16', 'https://upload.wikimedia.org/wikipedia/vi/thumb/2/29/%C3%81p_ph%C3%ADch_%C4%90%C3%A0o%2C_ph%E1%BB%9F_v%C3%A0_piano.jpg/330px-%C3%81p_ph%C3%ADch_%C4%90%C3%A0o%2C_ph%E1%BB%9F_v%C3%A0_piano.jpg', 'https://www.youtube.com/watch?v=qn1t_biQigc', '400000'),
('PMAI2024', 'Mai', 'Bộ phim kể về câu chuyện của Mai, một bà mẹ đơn thân đối mặt với những thách thức xã hội và sự chế giễu, nhưng tìm thấy sự kiên cường và hy vọng thông qua những tình bạn mới và tình yêu.', 'Lãng mạn, Tâm lý', 'Trấn Thành', 'Phương Anh Đào, Uyển Ân, Anh Đức, Trấn Thành, Ngọc Giàu, Khả Như,...', 'Nguyễn Hữu Tường Vi, Trấn Thành, Nguyễn Phương Thảo', 'Tiếng Việt', '131', '2024-02-10', 'T16', 'https://upload.wikimedia.org/wikipedia/en/3/36/Mai_2024_poster.jpg', 'https://www.youtube.com/watch?v=EX6clvId19s', '250000'),
('TFMM2024', 'Transformers One', 'Câu chuyện về nguồn gốc chưa từng kể của Optimus Prime và Megatron, những kẻ thù không đội trời chung nhưng từng là bạn bè thân thiết như anh em, đã thay đổi số phận của hành tinh Cybertron mãi mãi.', 'Hành động, Phiêu lưu, Hoạt hình, Gia đình, Khoa học viễn tưởng', 'Josh Cooley', 'Chris Hemsworth, Brian Tyree Henry, Scarlett Johansson', 'Don Murphy, Tom DeSanto, Loeno di Bonaventura,...', 'Tiếng Anh, Tiếng Việt', '104', '2024-09-27', 'PG', 'https://upload.wikimedia.org/wikipedia/en/a/a4/Transformers_One_Official_Poster.jpg', 'https://www.youtube.com/watch?v=0I2_qPsthDA', '200000'),
('DADW2024', 'Deadpool & Wolverine', 'Deadpool được cơ hội tham gia Vũ trụ Đa chiều của Marvel bởi Quyền lực Thời Gian, nhưng thay vào đó, anh tuyển dụng một phiên bản khác của Wolverine để cứu vì vũ trụ của mình khỏi sự tuyệt chủng.', 'Siêu anh hùng, Hành động, Phiêu lưu, Khoa học viễn tưởng', 'Shawn Levy', 'Josh Brolin, Ryan Reynolds, Morena Baccarin', 'Ryan Reynolds, Shawn Levy, Kevin Feige, Simon Kinberg, Lauren Shuler Donner', 'Tiếng Anh với phụ đề tiếng Việt', '128', '2024-07-26', 'R', 'https://cdn.marvel.com/content/1x/dp3_1sht_digital_srgb_ka_swords_v5_resized.jpg', 'https://www.youtube.com/watch?v=73_1biulkYk', '225000'),
('GOTF2024', 'Mộ Đom Đóm', 'Hai anh em Seita và Setsuko mất mẹ sau cuộc thả bom dữ dội của không quân Mỹ. Cả hai phải vật lộn để tồn tại ở Nhật Bản thời chiến II, tìm kiếm thức ăn cũng như thoát khỏi những khó khăn.',  'Chiến tranh, Hoạt hình, Kinh dị, Tâm lý', 'Takahata Isao', 'Tatsumi Tsutomu, Shiraishi Ayano, Shinohara Yoshiko', 'Hara Toru', 'Tiếng Nhật với phụ đề tiếng Việt', '89', '2024-10-04', 'T16', 'https://upload.wikimedia.org/wikipedia/vi/thumb/2/2a/GRAVE_OF_THE_FIREFLIES_-_Vietnam_re-release_poster.jpg/330px-GRAVE_OF_THE_FIREFLIES_-_Vietnam_re-release_poster.jpg', 'https://www.youtube.com/watch?v=HgDzVFMi238', '230000'),
('CBBT2024', 'Shin - Cậu Bé Bút Chì: Nhật Khủng Ký Long', 'Trong kỳ nghỉ hè, Shin và các bạn trong "Lực lượng Phòng vệ Kasukabe" nhận được lời mời tham quan công viên giải trí Đảo Khủng Long. Tại đây, Shin gặp một chú khủng long nhỏ tên là Nana, người đã gia nhập nhóm bạn của Shin. Tuy nhiên, bí mật về danh tính của Nana được hé lộ và một âm mưu xấu xa xuất hiện, buộc Shin và các bạn phải hành động để cứu ngày.', 'Phiêu lưu, Hoạt hình, Hài kịch, Gia đình', 'Shinobu Sasaki', 'Yumiko Kobayashi, Miki Narahashi, Toshiyuki Morikawa, Satomi Kourogi, Mari Mashiba', 'null', 'Tiếng Nhật, Tiếng Việt, phụ đề Tiếng Anh', '106', '2024-08-23', 'P', 'https://upload.wikimedia.org/wikipedia/vi/thumb/8/8a/%C3%81p_ph%C3%ADch%2C_Shin_C%E1%BA%ADu_b%C3%A9_b%C3%BAt_ch%C3%AC%2C_Nh%E1%BA%ADt_k%C3%BD_kh%E1%BB%A7ng_long_c%E1%BB%A7a_ch%C3%BAng_m%C3%ACnh.jpg/330px-%C3%81p_ph%C3%ADch%2C_Shin_C%E1%BA%ADu_b%C3%A9_b%C3%BAt_ch%C3%AC%2C_Nh%E1%BA%ADt_k%C3%BD_kh%E1%BB%A7ng_long_c%E1%BB%A7a_ch%C3%BAng_m%C3%ACnh.jpg', 'https://www.youtube.com/watch?v=5ugNOvwNycw', '150000');
